		var lat = - waypoints[punto][1];
		var lon = waypoints[punto][2];
		var ali = waypoints[punto][3];
        circ4dm('mapa', '_'+nombre, lon, lat, 0.01, 'fill: rgba(255,255,255,0.5); stroke: none; stroke-width: 0.0009; stroke-linecap: round;stroke-linejoin: round;');
        text4dma('mapa', nombre, lon, lat, styt, nombre,ali);
	}
}
function corregi(){
	var styt = 'fill: #00274C ; stroke: none; stroke-width: 0.0001; font-family: '+ fontfamily +'; font-size:0.008px';
	for (let punto = 0; punto < corregimientos.length; punto++) {
		var nombre = corregimientos[punto][0];
		var lat = - corregimientos[punto][1];
		var lon = corregimientos[punto][2];
		var ali = corregimientos[punto][3];
		circ4dm('mapa', '_'+nombre, lon, lat, 0.005, 'fill: rgba(255,255,255,0.5); stroke: none; stroke-width: 0.0009; stroke-linecap: round;stroke-linejoin: round;');
		text4dma('mapa', nombre, lon, lat, styt, nombre,ali);
	}
}
window.onload=panel();
window.addEventListener('resize', function (event) {panel();});
function panel() {
	ancho = Math.max(document.documentElement.clientWidth,  window.innerWidth);
	alto  = Math.max(document.documentElement.clientHeight, window.innerHeight)-2; 
	if (ancho > alto) { lado = alto; } else { lado = ancho; }
	document.getElementById('mapa').setAttribute('style', 'position:absolute; left: 0; top: 0; width:' + lado + 'px;height:' + lado + 'px;');
}
function coordenadas(){
		sty = 'fill: none; stroke: black; stroke-width: 0.0001; stroke-linecap: round; stroke-linejoin: round; stroke-dasharray: 0.001, 0.001;';
		styt = 'fill: black; stroke: none; stroke-width: 0.0001; font-family:monospace; font-size:0.006px';	
		for (var l= -75.740; l<=-75.228; l=l+0.02){		
			pts = l.toFixed(3) +',-6.438' + ' ' + l.toFixed(3) +',-5.926';		
			poli4dm('mapa', 'ml' + l, pts, sty); 		
			text4dma('mapa', 'mt' + l, (l).toFixed(3), -6.42, styt, l.toFixed(2),0);	
		}	
		for (var l= -6.438; l< -5.926; l=l+0.02){		
			pts = '-75.740,' + l.toFixed(3) + ' ' + '-75.228,' + l.toFixed(2);		
			poli4dm('mapa', 'mm' + l, pts, sty); 		
			text4dma('mapa', 'mtm' + l, -75.74, (l-0.001).toFixed(3), styt, (-l).toFixed(2), 0);	
		}
}
function poli4dm(panel, pid, pts, sty) {    if (pts.indexOf("undefined")<0 && pts.indexOf("NaN")<0){        var o4d;         if (document.getElementById(pid)) {o4d = document.getElementById(pid);} else {o4d = document.createElementNS("http://www.w3.org/2000/svg", "polyline"); o4d.setAttribute("id", pid); o4d.setAttribute("shape-rendering", "geometricPrecision"); }         o4d.setAttribute("points", pts); if (sty !== " ") {o4d.setAttribute("style", sty);} if (!document.getElementById(pid)) {document.getElementById(panel).appendChild(o4d);} }}
function text4dm(panel, pid, px, py, sty, txt) {var o4d; if (document.getElementById(pid)) {o4d = document.getElementById(pid);} else {o4d = document.createElementNS("http://www.w3.org/2000/svg", "text");    o4d.setAttribute("shape-rendering", "geometricPrecision"); o4d.setAttribute("id", pid);} o4d.setAttribute("x", px);   o4d.setAttribute("y", py); if (sty !== " ") {o4d.setAttribute("style", sty);} o4d.textContent = txt;	if (!document.getElementById(pid)) {document.getElementById(panel).appendChild(o4d);}}
function text4dma(panel,pid, px, py, sty, txt, ali) { 
    var o4d; if (document.getElementById(pid)) { 
        o4d = document.getElementById(pid); 
    } else { 
        o4d = document.createElementNS("http://www.w3.org/2000/svg", "text"); 
        o4d.setAttribute("shape-rendering", "geometricPrecision"); 
        o4d.setAttribute("id", pid); 
    } 
    o4d.setAttribute("x", px); 
    o4d.setAttribute("y", py); 
    o4d.textContent = txt; 
 
    if (ali !== "") {
        if (ali==0){
            sty += ";dominant-baseline: middle; text-anchor: start";
            o4d.setAttribute("alignment-baseline", "start"); 
        }
        if (ali==1){
            sty += ";dominant-baseline: middle; text-anchor: middle";
            o4d.setAttribute("alignment-baseline", "middle");
        }
        if (ali==2){
            sty += ";dominant-baseline: middle; text-anchor: end";
            o4d.setAttribute("alignment-baseline", "end");               
        }
        if (ali==3){
            sty += ";dominant-baseline: hanging; text-anchor: start";
            o4d.setAttribute("alignment-baseline", "hanging");   
        }
        if (ali==4){
            sty += ";dominant-baseline: top; text-anchor: start";
            o4d.setAttribute("alignment-baseline", "top");   
        }
    }	
    if (sty !== " ") {
         o4d.setAttribute("style", sty); 
    }
    if (!document.getElementById(pid)) { document.getElementById(panel).appendChild(o4d); } 
}
function circ4dm(panel, pid, pcx, pcy, pra, sty){if (!isNaN(pcx) && !isNaN(pcy)){var o4d; if (document.getElementById(pid)) {o4d = document.getElementById(pid);} else {o4d = document.createElementNS('http://www.w3.org/2000/svg', 'circle');  o4d.setAttribute('shape-rendering', 'geometricPrecision'); o4d.setAttribute('id', pid);} o4d.setAttribute('cx', pcx);	o4d.setAttribute('cy', pcy); o4d.setAttribute('r', pra);	                            if (sty !== ' ') {o4d.setAttribute('style', sty);}	                     if (!document.getElementById(pid)) {document.getElementById(panel).appendChild(o4d);}}}
</script>
